import React from "react";
import "./CafeSignIn.css";
import { useNavigate } from "react-router-dom";

const CafeSignIn = () => {
  const navigate = useNavigate();

  const handleSignIn = () => {
    // TODO: 백엔드 연동 시 여기에 로그인 요청 코드 추가
    console.log("로그인 시도");
  };

  const goToRegister = () => {
    navigate("/cafe-register-1");
  };

  return (
    <div className="cafe-signin">
      {/* 고정 헤더 */}
      <header className="register-fixed-header">
        <div className="header-content">
          <img src="/logo.png" alt="Bean Logo" className="header-logo" />
          <h1 className="header-text">Bean</h1>
        </div>
      </header>

      {/* 로그인 컨텐츠 */}
      <div className="signin-container">
        <h2 className="signin-title">로그인</h2>

        <input
          type="text"
          placeholder="아이디를 입력해주세요"
          className="signin-input"
        />
        <input
          type="password"
          placeholder="비밀번호를 입력해주세요"
          className="signin-input"
        />

        <div className="signin-options">
          <span>아이디 찾기</span>
          <span>|</span>
          <span>비밀번호 찾기</span>
        </div>

        <button className="signin-button" onClick={handleSignIn}>
          로그인
        </button>
        <button className="signup-button" onClick={goToRegister}>
          업체 등록하기
        </button>
      </div>
    </div>
  );
};

export default CafeSignIn;
